INSERT INTO `regelwerk` (`regelnummer`, `regeltitel`, `regeltext`) VALUES
('0', 'Vorwort', '<p part=\"\">Einradhockey ist eine Hockeyvariante, die auf Einrädern mit einem Tennisball gespielt wird. Es wird üblicherweise in einer Turnhalle gespielt. Diese Regeln können nicht jede Situation abdecken. Vor Spielbeginn müssen sich die Teams auf einen Spielraum bei der Regelauslegung geeinigt haben. Auf die unterschiedlichen Hintergründe der Spieler und die örtlichen Gegebenheiten muss Rücksicht genommen werden. Fairness aller Beteiligten ist unerlässlich.</p>'),
('1', 'Einräder', '<p part=\"\">Es dürfen nur Standardeinräder verwendet werden. Der maximale äußere Raddurchmesser ist 640 mm (24+ Klasse). Außerdem dürfen die Einräder keine scharfen oder hervorstehenden Teile haben, die zu Verletzungen führen könnten. Hiermit sind insbesondere Schnellspannerhebel und Schrauben gemeint. Die Pedale müssen aus Kunststoff oder Gummi sein.</p>'),
('2', 'Identifizierung der Spieler', '<p part=\"\">Alle Spieler eines Teams müssen Trikots in der gleichen Farbe tragen. Diese Farbe muss sich von der des Gegners deutlich unterscheiden. Bei Turnieren oder anderen großen Veranstaltungen sollte jedes Team zwei verschiedenfarbige Trikotsätze zur Verfügung haben.</p>'),
('3', 'Schläger', '<p part=\"\">Alle für Eishockey oder Floorball zugelassenen Schläger (außer Torwartschläger) können verwendet werden. Angebrochene oder gesplitterte Schläger müssen vor dem Spiel mit Klebeband umwickelt oder repariert werden. Ein Gummipuffer am oberen Ende des Schlägers wird empfohlen.</p>'),
('4', 'Anzahl der Spieler', '<p part=\"\">Ein Team auf dem Spielfeld besteht aus bis zu fünf Spielern, wobei ein Team mindestens drei Spieler benötigt, um ein Spiel zu beginnen. Das Auswechseln eines Spielers ist jederzeit möglich, wobei der ausgewechselte Spieler das Spielfeld in der eigenen Hälfte an derselben Stelle betreten muss, erst nachdem der andere Spieler das Spielfeld vollständig verlassen hat. Es ist nicht nötig, dies dem Schiedsrichter mitzuteilen. Jeder Spieler kann zu jeder Zeit Torwart sein. Der Torwart hat keine besonderen Rechte.</p>'),
('5', 'Spielablauf', '<p part=\"\"></p>'),
('5.1', 'Spieldauer', '<p part=\"a\">Die Spieldauer wird durch den Spielplan vorgegeben und es ist eine relative Spieldauer. Die Zeit wird nur unterbrochen, wenn der Schiedsrichter einen Zeitstopp anfordert. In der Pause werden die Seiten gewechselt. Zu Beginn jeder Halbzeit befinden sich alle Spieler in ihrer eigenen Spielfeldhälfte. Jede Halbzeit beginnt mit einem Bully am Mittelpunkt. Ist ein Spiel, das einen Sieger erfordert, nach der regulären Spielzeit noch unentschieden, gibt es einmal fünf Minuten Verlängerung ohne \"Golden Goal\". Ist der Spielstand auch dann noch unentschieden, gibt es ein Penalty-Schießen.</p><p part=\"b\">Hinweis: Gruppenspiele im Jeder-Gegen-Jeden-Modus erfordern in der Deutschen Einradhockeyliga keinen Sieger (siehe auch Abschnitt 4.9 im Ligamodus \"Platzierung auf einem Turnier\"). Ein Sieger wird nur im Doppel-KO-Modus oder bei (Halb-) Finalspielen benötigt.</p>'),
('5.2', 'Penaltyschießen', '<p part=\"a\">Drei der Spieler von jedem Team bekommen je einen Penaltyschuss. Ist der Spielstand immer noch ausgeglichen, schießt jedes Team einen weiteren Penaltyschuss, bis eine Entscheidung herbeigeführt ist. Es ist möglich, dass ein Spieler mehr als einen Schuss machen kann. Jedoch müssen in allen Fällen mindestens zwei andere Spieler einen Schuss machen, bevor derselbe Spieler nochmal schießen kann.</p><p part=\"b\">Für den Penaltyschuss müssen alle Spieler außer dem verteidigenden Torwart die entsprechende Spielfeldhälfte verlassen. Der Torwart muss sich in der Nähe der Torlinie befinden, zumindest bis der angreifende Spieler den Ball berührt hat. Der Schiedsrichter platziert den Ball am Mittelpunkt, und der ausführende Spieler wird nach dem Pfiff des Schiedsrichters den Ball von dort spielen und versuchen, ein Tor zu erzielen. Der Spieler muss in Bewegung Richtung Tor bleiben, eine Rückwärtsbewegung oder Anhalten ist nicht zulässig. Sobald der Ball geschossen wurde, wird der Penalty als abgeschlossen angesehen. Aus Abprallern aller Art (eine Ausnahme ist, wenn der Ball am Pfosten und/oder am Torwart abprallt, und dann direkt ins Tor geht) kann kein Tor erzielt werden. Sobald der Ball die Torlinie überquert, wird der Schuss als komplett angesehen. Wird der Torwart beim Penalty gefoult, ist dieser Penalty-Versuch vergeben. Wird der Ballführende gefoult, gibt der Schiedsrichter nach Ermessen ein Tor oder einen 6,50 m.</p>'),
('5.3', 'Einradfahren', '<p part=\"\">Der Spieler muss frei auf dem Einrad fahren. Er darf den Schläger als Stütze benutzen, darf sich aber nicht am Tor, der Wand oder Ähnlichem abstützen. Es reicht nicht aus, das Tor nur schnell für die Zeit loszulassen, während der Torwart am Spiel teilnimmt. Ein kurzzeitiges Abstützen an der Wand, um einen Sturz zu vermeiden, kann toleriert werden. Fällt ein Spieler vom Einrad, darf er solange in das Spiel eingreifen, bis er den Boden berührt. Beim Wiederaufstieg muss der Spieler auf dem Sattel sitzen und beide Füße auf den Pedalen haben, bevor er am Spiel wieder teilnehmen kann. Wenn ein Spieler, der nicht auf dem Einrad fährt, ein Eigentor schießt, wird die Vorteilsregel angewendet und das Tor ist gültig.</p>'),
('5.4', 'Ballkontakt', '<p part=\"\">Der Schläger, das Einrad und der gesamte Körper können genutzt werden, um den Ball zu spielen. All dies zählt als Ballkontakt. Ein Spieler darf den Ball nur dann zweimal hintereinander mit dem Körper spielen, wenn einer der Kontakte passiv ist. Wenn der Ball mit dem Körper gespielt wird, darf der Spieler den Ball nicht fangen oder auf andere Art halten, und der Kontakt sollte nur kurzzeitig sein. Für das Spiel mit Armen und Händen siehe auch Abschnitt 7.1.</p>'),
('5.5', 'Start und Stopp', '<p part=\"\">Start und Wiederaufnahme des Spiels werden immer durch den Pfiff des Schiedsrichters eingeleitet. Wenn ein Team das Spiel vor Anpfiff des Schiedsrichters beginnt, wird es sofort durch zwei oder mehr schnell aufeinanderfolgende Pfiffe gestoppt. Dann wird die letzte Schiedsrichterentscheidung wiederholt. Pfeift der Schiedsrichter während des Spiels, wird es sofort unterbrochen.</p>'),
('5.6', 'Spielaufnahme nach einem Tor', '<p part=\"\">Nach einem Tor bekommt das Team den Ball, gegen welches das Tor gefallen ist. Alle Spieler müssen in ihre eigene Hälfte. Nach dem Pfiff des Schiedsrichters wird das Spiel wieder aufgenommen, wenn der Ball oder ein Spieler des ballführenden Teams die Mittellinie überquert. Nach dem Überqueren der Mittellinie darf durch einen direkten Schuss ein Tor erzielt werden, z. B. ohne vorher den Ball an einen anderen Spieler abzuspielen.</p>'),
('5.7', 'Ball im Aus', '<p part=\"\">Wenn der Ball das Spielfeld verlässt, wird das Spiel sofort unterbrochen (auch wenn der Ball zurückkommt). Es gibt einen Freistoß gegen den Spieler, der den Ball zuletzt berührt hat. Der Freistoß wird 1 m von der Seitenbande entfernt ausgeführt.</p>'),
('5.8', 'Ball zwischen den Speichen', '<p part=\"\">Bleibt der Ball zwischen den Speichen eines Einrades stecken, bekommt das gegnerische Team einen Freistoß.</p>'),
('6', 'Sicherheit', '<p part=\"a\">Die Sicherheit der Spieler und Zuschauer verdient hohe Aufmerksamkeit. Daher müssen die Sicherheitsregeln streng befolgt werden und die Ausrüstung muss in gutem Zustand sein.</p><p part=\"b\">Alle Gegenstände, die vom Körper abstehen und Verletzungen verursachen können (z. B. Uhren, Ketten, Ohrringe) müssen entfernt werden. Falls dies unmöglich ist, müssen die Gegenstände ausreichend abgedeckt sein, um Verletzungen unwahrscheinlich zu machen. Schuhe müssen getragen werden und die Schnürriemen müssen kurz oder eingesteckt sein. Die folgende optionale Kleidung wird vorgeschlagen: Knieschoner, Handschuhe, Helm, Schutzbrille und Zahnschutz.</p>'),
('7', 'Torschüsse', '<p part=\"\"></p>'),
('7.1', 'Torschuss mit Armen oder Händen', '<p part=\"\">Ein Tor ist ungültig, wenn es mit dem Arm oder der Hand erzielt wurde. Das verteidigende Team bekommt einen Freistoß. Diese Regel gilt nicht für Eigentore.</p>'),
('7.2', 'Fernschuss', '<p part=\"\">Ein Tor ist ungültig, wenn der letzte Ballkontakt eines Spielers noch in der eigenen Hälfte war. Das verteidigende Team bekommt einen Freistoß. Diese Regel gilt nicht für Eigentore.</p>'),
('7.3', 'Ball außen im Netz', '<p part=\"\">Wenn der Ball außen im Netz hängen bleibt, oder wenn der Ball durch ein Loch im Netz von der Seite oder von hinten in das Tor gelangt, gibt es einen Freistoß gegen das Team, das den Ball zuletzt berührt hat.</p>'),
('8', 'Fouls', '<p part=\"\"></p>'),
('8.1', 'Allgemeine Erwägungen', '<p part=\"\">Alle Spieler müssen sich so verhalten, dass andere nicht gefährdet werden. Übertriebene Härte kann zu Verletzungen führen und muss daher vermieden werden. Das Spiel ist körperlos: Die Gegner und ihre Einräder dürfen nicht berührt werden. Die Spieler müssen darauf achten, den Gegner nicht mit dem Schläger zu treffen, insbesondere nach einem Schuss. Nur in der Nähe des Balles (definiert als Ball innerhalb des Kreises um den Spieler mit dem Radius der ausgestreckten Armlänge plus Schläger) darf ein Spieler den Schläger des Gegners mit dem eigenen Schläger berühren, um den Gegner zu blocken. Dieser Kontakt darf jedoch nicht hart sein. Es ist nicht erlaubt, die Kelle des Schlägers nach unten zeigen zu lassen, um auf diese Art den gegnerischen Schläger zu verhaken. Es ist im Prinzip erlaubt, den gegnerischen Schläger anzuheben, solange dies nicht mit übertriebener Härte geschieht. Wenn der gegnerische Schläger zu einem hohen Schläger angehoben wird, wird es immer als übertriebene Härte angesehen. Absichtliche Zeitverzögerung ist nicht erlaubt und kann zu einer Strafe und zu einem Anhalten der Zeit führen. Um den Spielfluss zu erhalten, sollten Regelwidrigkeiten, die das Spielgeschehen nicht beeinflussen, nicht geahndet werden.</p>'),
('8.2', 'Vorfahrtsregeln', '<p part=\"a\">Die folgenden Regeln gelten, wenn es zu einer Berührung der Spieler kommt:</p><ul><li><p part=\"b\">Kein Spieler darf durch Erzwingen der Vorfahrt einen anderen Spieler gefährden (z.B. an die Wand abdrängen).</p><li><p part=\"c\">Pendelt ein Spieler auf der Stelle oder stützt sich auf seinen Schläger, muss ihm ausgewichen werden. Der pendelnde oder ruhende Spieler muss jedoch sicherstellen, dass der Schläger nicht andere Spieler nach Regel 8.3 subt.</p><li><p part=\"d\">Fahren zwei Spieler nebeneinander, darf der Voranfahrende die Richtung bestimmen. Sind die Spieler auf gleicher Höhe, darf der ballführende die Richtung bestimmen.</p><li><p part=\"e\">Fahren zwei Spieler direkt oder im stumpfen Winkel aufeinander zu, müssen beide darauf achten, einen Kontakt zu vermeiden. Wenn ein Kontakt stattfindet, wird der Schiedsrichter denjenigen bestrafen, der den Kontakt anscheinend herbeigeführt hat.</p><li><p part=\"f\">In allen Fällen, die hier nicht erwähnt sind, liegt es am Schiedsrichter, eine Entscheidung zu treffen.</p></ul>'),
('8.3', 'SUB (Stick Under Bike)', '<p part=\"\">Ein Spieler, der seinen Schläger so hält, dass ein gegnerischer Spieler darüber oder dagegen fährt, begeht immer ein Foul, unabhängig von der Situation.</p>'),
('8.4', 'SIB (Stick In Bike)', '<p part=\"\">Gerät ein Schläger zwischen die Speichen eines Gegners, so begeht der Besitzer des Schlägers ein Foul.</p>'),
('8.5', 'Beleidigungen', '<p part=\"\">Ein Spieler darf weder den Schiedsrichter noch andere Spieler beleidigen.</p>'),
('8.6', 'Verschieben des Tores', '<p part=\"\">Die Spieler dürfen das Tor nicht verschieben.</p>'),
('8.7', 'Hindernis', '<p part=\"\">Ein Spieler, der sich nicht auf dem Einrad befindet, darf kein Hindernis für das gegnerische Team darstellen. Der Spieler wird als Hindernis angesehen, wenn er, sein Einrad oder sein Schläger vom Ball getroffen wird, und auch, wenn sich ein Gegner seinetwegen nicht frei bewegen kann. Der Spieler sollte an der Stelle wieder aufsteigen, an der er abgestiegen ist, falls notwendig aber zuerst dem Spielgeschehen ausweichen.</p>'),
('8.8', 'Schlägerwurf', '<p part=\"\">Ein Spieler darf seinen Schläger nicht absichtlich fallen lassen oder werfen.</p>'),
('8.9', 'Oberes Schlägerende', '<p part=\"\">Das obere Ende des Schlägers muss ständig mit einer Hand abgedeckt sein, um Verletzungen anderer Spieler zu vermeiden. Ein kurzes Entfernen der oberen Hand vom Schläger, um den Ball mit dieser Hand zu spielen, ist akzeptabel, wenn dies auf sichere Weise geschieht.</p>'),
('8.10', 'Hoher Schläger', '<p part=\"\">Die Kelle des Schlägers muss immer unterhalb der eigenen Hüfthöhe und der aller Spieler in der Nähe sein, die gefährdet sein könnten. Ausnahme: Um einen Torschuss abzuwehren, darf in unmittelbarer Nähe zum eigenen Tor das untere Schlägerende bis zur Höhe der Querlatte des Tores gehoben werden.</p>'),
('9', 'Strafen', '<p part=\"a\">Bei jeder Regelwidrigkeit muss der Schiedsrichter eine Strafe verhängen oder Vorteil geben. Wenn der Schiedsrichter Vorteil gibt, dann pfeift er das Spiel nicht ab und sollte das Handzeichen für Vorteil geben und laut „Vorteil\" rufen. Wenn ein Vorteil nicht erlangt wurde, sollte der Schiedsrichter die entsprechende Strafe für den ursprünglichen Regelverstoß am ursprünglichen Ort durchsetzen. Zusätzlich können Spieler für das ursprüngliche Vergehen nach dem Vorteil einen Feldverweis erhalten. Der Schiedsrichter sollte diesen Feldverweis nicht vergeben, bis das regelverstoßende Team in Ballbesitz gelangt und sollte das Spiel mit einem Bully am Ort des Ballbesitzwechsels wieder aufnehmen.</p><p part=\"b\">Wenn zwei oder mehr Spieler stürzen und es nicht klar ist, ob ein Foul begangen wurde, können die Schiedsrichter das Spiel unterbrechen und mit einem Bully fortsetzen.</p>'),
('9.1', 'Freistoß', '<p part=\"a\">Der Freistoß ist die Standardstrafe für alle Regelwidrigkeiten. Er wird immer angewendet, außer in den Fällen, die in den Abschnitten 9.2 bis 9.4 explizit erwähnt werden. Der Freistoß wird an der Stelle ausgeführt, wo die Regelwidrigkeit begangen wurde. Ausnahmen: Wenn ein Team einen Freistoß in der gegnerischen Torzone erhält, wird der Freistoß vom nächstgelegenen Eckpunkt ausgeführt (Eckstoß). Wenn ein Team einen Freistoß in der eigenen Torzone bekommt, wird der Freistoß 1 m vor der Torlinie ausgeführt (Torabstoß). Wenn eine Strafe für Zeitspiel verhängt wird, wird der Freistoß am Mittelpunkt ausgeführt.</p><p part=\"b\">Der Freistoß ist indirekt. Der ausführende Spieler darf den Ball beim Freistoß nur einmal berühren bis zum Kontakt eines anderen Spielers. Der Ball soll mit dem Schläger geschlagen werden. Der Ball darf ebenfalls geschlenzt und gelupft werden. Gegnerische Spieler müssen mit Einrad und Schläger einen Mindestabstand von 2 m zum Ball einhalten.</p>'),
('9.2', '6,50 m', '<p part=\"a\">Wird durch eine Regelwidrigkeit eine direkte Torchance verhindert, so wird ein 6,50 m gegeben. Die folgenden Situationen sind Beispiele für eine Verhinderung einer direkten Chance und sollten mit einem 6,50 m geahndet werden:</p><ul><li><p part=\"b\">Ein angreifender Spieler wird in der gegnerischen Torzone gefoult, während er in einer guten Position ist, ein Tor zu erzielen.</p><li><p part=\"c\">Ein angreifender Spieler wird gefoult, während er sich zum gegnerischen Tor bewegt und sich vor ihm nur ein einziger Gegner befindet.</p></ul><p part=\"d\">Der Ball wird auf den 6,50 m Punkt gelegt. Ein Spieler des verteidigenden Teams geht in das Tor. Sein Rad muss in einer Entfernung von höchstens 0,50 m von der Torlinie den Boden berühren. Das andere Team bestimmt einen Spieler, der den 6,50 m ausführt. Alle anderen Spieler müssen die Torzone verlassen. Der 6,50 m ist direkt. Der ausführende Spieler darf den Ball beim 6,50 m nur einmal berühren. Der Ball soll mit dem Schläger geschlagen werden. Der Ball darf ebenfalls geschlenzt und gelupft werden. Ist der Torschuss erfolglos, geht das Spiel weiter, sobald der Ball den Torpfosten berührt, der Torwart den Ball berührt oder der Ball die verlängerte Torlinie überquert. Ein 6,50 m, der am Ende des Spiels oder nach dem Ende einer Halbzeit gegeben wird, wird noch ausgeführt, aber das Spiel wird nach einem erfolglosen Schuss nicht fortgesetzt.</p>'),
('9.3', 'Straftor', '<p part=\"\">Wenn das verteidigende Team durch regelwidriges Spielen ein Tor verhindert und wenn nach Meinung des Schiedsrichters der Ball direkt auf das Tor zuging und mit Sicherheit in das Tor gegangen wäre, wenn kein Spieler ihn berührt hätte, kann ein Straftor für das angreifende Team gegeben werden. Wenn irgendwelche Zweifel darüber bestehen, ob der Ball ins Tor gegangen wäre, muss ein 6,50 m gemäß Abschnitt 9.2 gegeben werden.</p>'),
('9.4', 'Bully', '<p part=\"\">Um das Spiel ohne Strafe gegen eines der Teams wieder aufzunehmen, kann ein Bully genutzt werden. Für das Bully lässt der Schiedsrichter den Ball zwischen zwei gegeneinander spielenden Spielern fallen, wobei alle anderen Spieler mit Einrad und Schläger einen Mindestabstand von 2 m zum Ball einhalten müssen. Der Ball sollte von unterhalb der Hüfthöhe der Spieler in der Nähe fallen gelassen werden. Das Spiel beginnt mit Pfiff des Schiedsrichters, wenn der Ball den Boden berührt. Ein Bully während des Spiels wird dort ausgeführt, wo der Ball bei der Unterbrechung war. Ausnahme: Innerhalb der Torzone wird das Bully immer am nächstgelegenen Eckpunkt ausgeführt.</p>'),
('9.5', 'Feldverweis', '<p part=\"a\">Der Schiedsrichter kann einen Spieler für die Dauer von 2 Minuten, 5 Minuten oder für den Rest des Spiels des Feldes verweisen. Dies geschieht bei Unsportlichkeit sowie absichtlicher oder gefährlicher Missachtung der Regeln. Während ein Spieler auf der Strafbank sitzt, darf das Team keinen Ersatzspieler für ihn einwechseln. Der betroffene Spieler muss das Spielfeld in der eigenen Hälfte wieder betreten.</p><p part=\"b\">Wenn ein Spieler in den letzten drei Minuten des Spiels einen Feldverweis erhält und das Spiel mit einem Freistoß fortgeführt werden würde, so wird anstelle des Freistoßes ein 6,50 m gegeben.</p><p part=\"c\">Die Zeit sollte angehalten werden, während die Schiedsrichter über eine angemessene Strafe diskutieren und diese den Spielern erklären. Bei der Bestrafung eines Spielers sollten die Schiedsrichter die folgenden Richtlinien berücksichtigen: </p><p part=\"d\">Feldverweis für 2 Minuten:<ul><li>Absichtliche Spielverzögerung<li>Wiederholte Fouls desselben Spielers<li>Absichtliches Foul<li>Gefährliches Spiel<li>Dem Schiedsrichter Widerworte geben (andauernde Widerrede oder Entscheidungen in Frage stellen)<li>Absichtliche Verwendung unzulässiger Ausrüstung und Kleidung<li>Absichtlich zu viele Spieler auf dem Feld haben.</ul></p><p part=\"e\">Feldverweis für 5 Minuten:<ul><li>Wiederholte Fouls eines Spielers, der bereits einen Feldverweis für 2 Minuten erhalten hat.<li>Absichtliches, gefährliches Foul </ul></p><p part=\"f\">Feldverweis für den Rest des Spiels:<ul><li>Mehrmaliges Foulspiel eines Spielers, der bereits einen Feldverweis für 5 Minuten erhalten hat<li>Gewalttätiges Verhalten</ul></p>'),
('10', 'Schiedsgericht', '<p part=\"\"></p>'),
('10.1', 'Mitglieder des Schiedsgerichts', '<p part=\"\">Das Schiedsgericht besteht aus:<ul><li>1. Schiedsrichter (1)<li>2. Schiedsrichter (2)<li>Schreiber (S)<li>Zeitnehmer (Z)</ul></p>'),
('10.2', 'Die Schiedsrichter', '<p part=\"a\">Die beiden Schiedsrichter stellen sich auf gegenüberliegenden Seiten auf. Sie versuchen, in Ballnähe zu bleiben. Sie befinden sich nicht auf dem Einrad. Die Kleidung der Schiedsrichter muss eine andere Farbe als die der Spieler haben. Beide Schiedsrichter sind für das Überprüfen aller Regelverstöße zuständig. Der 1. Schiedsrichter hat drei zusätzliche Aufgaben:</p><ul><li><p part=\"b\">Der 1. Schiedsrichter überstimmt den 2. Schiedsrichter, falls beide unterschiedlicher Meinung sind.</p><li><p part=\"c\">Der 1. Schiedsrichter pfeift das Spiel nach jeder Unterbrechung mit einem langen Pfiff wieder an.</p><li><p part=\"d\">Der 1. Schiedsrichter lässt den Ball zum Bully fallen.</p></ul>'),
('10.3', 'Der Schreiber', '<p part=\"\">Der Schreiber sitzt am Schreibertisch und sorgt dafür, dass die Anzeigetafel jederzeit den aktuellen Spielstand angibt. Nach einem Tor nimmt er Blickkontakt mit dem 1. Schiedsrichter auf, um zu sehen, ob dieser das Tor für gültig oder ungültig erklärt. Nach Ende des Spieles trägt der Schreiber den Endstand im Spielbericht ein.</p>'),
('10.4', 'Der Zeitnehmer', '<p part=\"\">Der Zeitnehmer überwacht mit einer Stoppuhr und/oder einer Anzeigetafel die Spielzeit. Die Zeit wird bei jedem Anpfiff des Schiedsrichters gestartet. Jede Halbzeit endet mit dem Ton der Anzeigetafel (z.B. Hupe, Glocke, Gong) oder dem Pfiff des Zeitnehmers. Außerdem stoppt der Zeitnehmer die Zeit immer, wenn der Schiedsrichter einen Zeitstopp anfordert. Im Falle eines Feldverweises notiert der Zeitnehmer den Zeitpunkt des Feldverweises und den Zeitpunkt, wann der betroffene Spieler das Feld wieder betreten darf.</p>'),
('10.5', 'Vor dem Spiel', '<p part=\"a\">Die Schiedsrichter rufen vor dem Spiel sämtliche Spieler (einschließlich Ersatzspieler) auf dem Spielfeld zusammen. Sie überprüfen Folgendes:</p><ul><li><p part=\"b\">Unterscheiden sich die Trikots der Spieler farblich deutlich voneinander? </p><li><p part=\"c\">Erfüllen alle Spieler die Sicherheitsregeln für Kleidung?</p><li><p part=\"d\">Ist der Ball geeignet? </p><li><p part=\"e\">Sind Einräder und Schläger ordnungsgemäß, ohne spitze oder herausragende Teile, an denen sich die Spieler verletzen könnten? </p><li><p part=\"f\">Sie erklären den Spielern, wie streng sie pfeifen werden.</p><li><p part=\"g\">Falls nötig, teilen sie den Spielern mit, wie lange das Spiel dauern wird und ob es im Falle eines Unentschiedens eine Verlängerung geben wird.</p></ul>'),
('10.6', 'Allgemeines', '<p part=\"a\">Eine Spielunterbrechung erfolgt durch einen kurzen und lauten Pfiff. Wurde der Pfiff nicht von allen Spielern gehört, muss erneut gepfiffen werden. Es ist nicht möglich, das Spiel weiterlaufen zu lassen, nachdem gepfiffen wurde.</p><p part=\"b\">Die Schiedsrichter sollten durch bestimmtes und ruhiges Auftreten überzeugen. Entscheidungen werden auf Anfrage erläutert, sie werden jedoch nicht mit den Spielern ausdiskutiert. In einer unklaren Situation können die Schiedsrichter die Spieler befragen, bevor sie eine endgültige Entscheidung treffen.</p><p part=\"c\">Weder die Schiedsrichter noch Zeitnehmer und Schreiber dürfen sich vom Spiel ablenken lassen. Vor allem dürfen sie sich während des Spiels nicht mit den Zuschauern unterhalten.</p><p part=\"d\">Wenn zwei Regelverstöße direkt hintereinander auftreten, wird nur der erste bestraft. Ausnahme: Unsportliches Verhalten sollte auch nach einer Spielunterbrechung bestraft werden.</p><p part=\"e\">Nach einem Tor wartet der Schiedsrichter, bis beide Teams wieder in ihrer eigenen Hälfte und spielbereit sind. Erst dann pfeift der erste Schiedsrichter das Spiel wieder an.</p><p part=\"f\">Zur Anwendung der Vorteilsregel macht der Schiedsrichter das normale Handzeichen für einen Freistoß und zeigt mit dem Arm in die entsprechende Richtung. Zusätzlich kann er \"Vorteil\" oder \"Weiter!\" rufen, aber er pfeift nicht ab. Wird kein Vorteil erreicht, wird letztendlich doch abgepfiffen, um den ursprünglichen Regelverstoß zu ahnden. Ansonsten wird das Ende des Vorteils durch Senken des Arms und/oder durch den Ruf \"Vorteil Ende\" signalisiert.</p><p part=\"g\">Nach jeder Spielunterbrechung erklärt der Schiedsrichter kurz die Entscheidung. Außerdem macht er das entsprechende Handzeichen.</p><p part=\"h\">Die Schiedsrichter unterbrechen das Spiel, wenn eine Verletzung auftritt. Nach der Unterbrechung bekommt das Team einen Freistoß, das zum Zeitpunkt der Unterbrechung im Ballbesitz war. Falls es nicht klar ist, wer im Ballbesitz war, wird das Spiel mit einem Bully fortgesetzt.</p><p part=\"i\">Wird ein Schiedsrichter durch den Ball getroffen, wird das Spiel nur dann unterbrochen, wenn der Kontakt den Spielfluss derart verändert hat, dass eines der Teams dadurch profitiert. In diesem Fall wird das Spiel mit einem Bully wieder aufgenommen.</p>'),
('10.7', 'Handzeichen für Schiedsrichter', '<p part=\"a\">\"Freistoß\": Mit dem ausgestreckten Arm in die Richtung zeigen, in die das Team spielt, das den Freistoß bekommt. Dieses Handzeichen wird auch für die Vorteilsregel benutzt.</p><p part=\"b\">\"Bully\": Beide Daumen senkrecht heben.</p><p part=\"c\">\"6,50 m\": Mit dem Zeigefinger auf den 6,50 m Punkt zeigen.</p><p part=\"d\">\"Kein Foul\": Beide Arme horizontal ausstrecken. Dieses Handzeichen wird verwendet, um anzuzeigen, dass in einer kritischen Situation kein Foul vorlag. Es wird nicht zusammen mit einem Pfiff verwendet.</p><p part=\"e\">\"Zeitstopp\": Mit beiden Händen den Buchstaben \"T\" formen. Ein Zeitstopp wird als notwendig erachtet, wenn z. B. ein Spieler verletzt wurde, absichtliches Zeitspiel vorliegt, sich die Schiedsrichter besprechen oder sich die Schiedsrichter mit den Spielern besprechen.</p><p part=\"f\">\"Tor\": Mit einem Arm senkrecht nach oben zeigen. Die Schiedsrichter sollten dabei darauf achten, dass der Schreiber das Tor notiert. Um dies zu kontrollieren, kann es für die Schiedsrichter hilfreich sein, den Spielstand selbst aufzuschreiben.</p><p part=\"g\">\"Kein Tor\": Horizontale Bewegung der flachen Hand (Handfläche nach unten). Mit diesem Handzeichen wird ein Torschuss für ungültig erklärt. Dies ist z.B. der Fall, wenn der Ball zuletzt durch Hand oder Arm berührt wurde, bei einem Fernschuss, wenn der Ball von außen durch das Netz ins Tor gelangt ist oder wenn das Spiel bereits unterbrochen war, bevor der Ball ins Tor ging. Die Schiedsrichter sollten hier darauf achten, dass der Schreiber das ungültige Tor nicht versehentlich zählt.</p><p part=\"h\">\"Hoher Schläger\": Die geballten Fäuste direkt aneinander über den Kopf halten.</p><p part=\"i\">\"SUB und SIB\": Sein Schienbein mit der Handkante schlagen.</p><p part=\"j\">\"Hindernis\": Die Arme vor der Brust überkreuzen.</p><p part=\"k\">\"Körperkontakt\": Direkt vor der Brust die geballte Faust einer Hand gegen die offene Handfläche der anderen Hand schlagen.</p><p part=\"l\">\"Feldverweis für 2 Minuten\" und auch \"Zweifaches Handspiel\": Zwei gespreizte Finger heben.</p><p part=\"m\">\"Feldverweis für 5 Minuten\": Fünf gespreizte Finger heben.</p>'),
('11', 'Spielfeld', '<p part=\"\"></p>'),
('11.1', 'Größe', '<p part=\"\">Das Feld hat eine Länge von 35-45 m und eine Breite von 20-25 m. Es wird von einer Bande umgeben. Die Ecken sind abgerundet oder abgeschrägt. Es muss über einen dämpfenden Hallensportboden verfügen.</p>'),
('11.2', 'Tore', '<p part=\"\">Die Torpfosten sind 2,50 m von den Enden des Spielfeldes (Grundlinie) entfernt, sodass das Tor von den Spielern umfahren werden kann. Ihre lichte Höhe ist 1,20 m und ihre lichte Breite 1,80 m. Die Tore müssen so beschaffen sein, dass der Ball nicht von hinten oder von der Seite hineingelangen kann. Die Tore dürfen keine scharfen, spitzen oder hervorstehenden Teile haben.</p>'),
('11.3', 'Linien', '<p part=\"\">Die Mittellinie unterteilt das Feld in zwei gleiche Hälften und der Mittelpunkt ist in der Mitte der Mittellinie. Vor jedem Tor ist im Abstand von 6,50 m ein Punkt. Die Torlinie verbindet die Torpfosten auf dem Spielfeld. Die Eckpunkte befinden sich 1 m vom Spielfeldrand entfernt auf beiden Seiten der verlängerten Torlinie. Die 6,50 m Linien sind parallel zu den Torlinien und gehen durch die 6,50 m Punkte. Die Torzonen sind die Flächen zwischen den 6,50 m Linien und den Grundlinien.</p>'),
('12', 'Ball', '<p part=\"\">Es wird ein Tennisball benutzt, der nach dem Aufprall auf Beton mehr als 30 % der ursprünglichen Höhe erreicht.</p>'),
('13', 'Trainingszeit', '<p part=\"\">Bei einem Turnier muss den Teilnehmern ausreichend Zeit zum Training und/oder zum Aufwärmen angeboten werden.</p>');
